"use strict";function injectCSSFading(e){e.addEventListener("click",t=>{t.preventDefault(),t.stopPropagation(),document.querySelectorAll(".transition").forEach(e=>e.className+=" out");const n=setTimeout(()=>{window.location=e.href,clearTimeout(n)},300)})}document.onreadystatechange=function(){"complete"===document.readyState&&document.querySelectorAll(".ubergang").forEach(e=>{injectCSSFading(e)})};
